import { useSelector } from "react-redux";
import { createStructuredSelector } from "reselect";
import { selectCollectionId } from "../../redux/shop/shopSelectors";
import CollectionItem from "../../Components/collectionItems/CollectionItem";

import "./collection.style.scss";

const Collection = ({ collection, match }) => {
  const { collections } = useSelector(state =>
    createStructuredSelector({
      collections: selectCollectionId(props.match.params.collectionId)(state)
    })
  );
  console.log(match);
  return (
    <div className="collection">
      <h2>Collection Page</h2>
    </div>
  );
};

export default Collection;
